import SimpleImageSlider from "react-simple-image-slider";
import "./styles.css"

const Home = ()=>{
    const images = [
        { url: "images/1.jpg" },
        { url: "images/2.jpg" },
        { url: "images/3.jpg" },
        { url: "images/4.jpg" },
        { url: "images/5.jpg" },
        { url: "images/6.jpg" },
        { url: "images/7.jpg" },
      ];
      
    return(
        <div className="PHome">
           <div className="slider">
            <SimpleImageSlider
                width={window.innerWidth}
                height= {window.innerHeight -200}
                images={images}
                showBullets={true}
                showNavs={true}
                className="slider"
            />
            </div>
            <div></div>
        </div>
    )
}
export default Home;
